import React from 'react'


const List =(props)=> {
  return (
    <ul>
      {props.List.map((item)=>(
        <li key={item.objectID}>
        <a href={item.url} target="_blank">  {item.title} </a>
              </li> 
      ))}
  </ul>
  )
}
export default List;
